import React, { useEffect, useState } from 'react';
import "../AppLibrary/AppLibrary.css";
import VideoElement from "../VideoElement/VideoElement";
import $ from 'jquery';



export default function AppLibrary() {

  const [videoArray, setVideoArray] = useState([]);

  useEffect(()=>{
    $.ajax({
      url: "https://api.mux.com/video/v1/assets",
      beforeSend: function(xhr) { 
        xhr.setRequestHeader("Authorization", "Basic " + btoa("768959a2-7b04-44c2-b584-5800ffc71297:7fB9Fa8rXoCKI3MNDloDusslbS6gwZMoHj6dZldFBNoFEhUTT/pr+c/aI+4S5kImvDtCrBkk14a")); 
      },
      type: 'GET',
      contentType: 'application/json',
      success: function (data) {
        // alert(JSON.stringify(data));
        // window.test=data.data;
        setVideoArray(data.data);
      },
      error: function(){
        alert("Cannot get recordings");
      }
  });
  },[])




  return (


    <div>
      <h1>Video library</h1>
      <div className='gallery'>
          {videoArray.map(item => 
            <div >
              {/* <VideoElement src={'https://stream.mux.com/'+item.playback_ids[0].id+'.m3u8'}/> */}
              <VideoElement src="https://stream.mux.com/tkEsIU00zbivgJOmBrHbwVNddkD201XtmoqxgE8bxQm58.m3u8"/>

            </div>
          )}
      </div>



    </div>


  );
}
